import React from 'react';
import './App.css';
import Routes from "./routes/Routes";
import SideBar from "./component/Nav/SideBar"
function App() {
  const isLoggedIn = this.state.connected;
  return (

    <div className="App" style={{ display: "flex" }}>
      {isLoggedIn ? (
        <SideBar/>
      ) : (
        <h1>d</h1>
      )}
        <SideBar/>
    
      <Routes/>
    </div>
  );
}

export default App;
